import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";




function App() {


  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center">
      <ShortsCarousel />
    </div>
    </div>
  );
}

export default App;
